from bs4 import BeautifulSoupimport requestsimport reimport numpy as npimport pandas as pdRoomList = pd.DataFrame()for num in range(127):    default_link='https://rentinsingapore.com.sg/properties-for-rent/page-%d'%num    html=requests.get(default_link).text    soup=BeautifulSoup(html,'lxml')    house=soup.find_all('h3',{'class':'room-sublocation mobile-room-sublocation'})    price=soup.find_all('div',{'class':'room-price'})    info=soup.find_all('h4',{'class':'room-name'})    RoomName=[]    RoomPrice=[]    RoomInfo=[]    for link in house:        RoomName.append(link.text.strip().split('-')[-1])    #print(RoomName)    for p in price:        RoomPrice.append(p.text.strip())    #print(RoomPrice)    for i in info:        RoomInfo.append(i.text.strip())    RoomData={        "RoomName":RoomName,        "RoomPrice":RoomPrice,        "RoomInfo":RoomInfo    }    RoomData=pd.DataFrame(RoomData)    RoomList=pd.concat([RoomData,RoomList])RoomList=RoomList.reset_index()RoomList.to_csv('RoomList.csv')print('Download has done.')